import Header from "./Header";
import Head from "next/head";

const layoutStyle = {
  margin: 20
};

const Layout = props => {
  console.log(props);
  return (
    <>
      <Head>
        <title>ryangrunest</title>
      </Head>
      <div style={layoutStyle}>
        <Header />
        {props.children}
      </div>
    </>
  );
};

export default Layout;
